import React from "react";   
import dbMaterial from "./dbMaterial.js";
import { Link, useHistory, useParams }from "react-router-dom";
import "./Material.css";

function Material() {

    const {id} = useParams();

    const filtered =  dbMaterial.filter((item) => item.id == id );

    const handleClick = (e) => {
        alert("Handled Click");
    }

    return(
        <div className="material">
            { filtered.map( (mat, index) => (
            <div className="material__item" onClick={(e)=>handleClick(e)}>
                 <p>{mat.nome}</p>
            </div>
          ))
        }
        </div>
    )
}


export default Material;
